import React from "react";

impo

function Auto_Top_Slider(){
    return(
        <>
        <Slide_Product
               top_slider_catagory_image={props.top_slider_catagory_image}
               ></Slide_Product>
        </>
    );
}

export default Auto_Top_Slider;
